import React from 'react';
import Logo from '../../Assets/logoNomeBranco.png';
import styles from './Header.module.css';

const Header = () => {
  return (
    <section className={styles.container}>
      <img src={Logo} alt="Logo" />
    </section>
  )
}

export default Header;
